"creater": "Bibhuprasad Mahakud",
"status_": "Completed",
"Id": "100023",
"totalCredit":"10",
"scored": "7"  
  }
  ]

function Completed(){
    return(
      <div className={classes.completeddiv}>

      {
        AllAssignment.map((oneAssignment, index)=>{

          return <AssignmentBox key={index} oneAssignment={oneAssignment}/>

          })

      }

      </div>
    );
};
export default Completed;
